function convertToRoman(num) {
    var outputString = "";
    console.log(Math.floor(num % 10000 / 1000));

    for (var i = 0; i < Math.floor(num % 10000 / 1000); i++) {
        outputString += "M"
    }
    switch (Math.floor(num % 1000 / 100)) {
        case 1:
            outputString += "C";
            break;
        case 2:
            outputString += "CC";
            break;
        case 3:
            outputString += "CCC";
            break;
        case 4:
            outputString += "CD";
            break;
        case 5:
            outputString += "D";
            break;
        case 6:
            outputString += "DC";
            break;
        case 7:
            outputString += "DCC";
            break;
        case 8:
            outputString += "DCCC";
            break;
        case 9:
            outputString += "CM";
            break;
    }
    switch (Math.floor(num % 100 / 10)) {
        case 1:
            outputString += "X";
            break;
        case 2:
            outputString += "XX";
            break;
        case 3:
            outputString += "XXX";
            break;
        case 4:
            outputString += "XL";
            break;
        case 5:
            outputString += "L";
            break;
        case 6:
            outputString += "LX";
            break;
        case 7:
            outputString += "LXX";
            break;
        case 8:
            outputString += "LXXX";
            break;
        case 9:
            outputString += "XC";
            break;
    }

    switch (Math.floor(num % 10)) {
        case 1:
            outputString += "I";
            break;
        case 2:
            outputString += "II";
            break;
        case 3:
            outputString += "III";
            break;
        case 4:
            outputString += "IV";
            break;
        case 5:
            outputString += "V";
            break;
        case 6:
            outputString += "VI";
            break;
        case 7:
            outputString += "VII";
            break;
        case 8:
            outputString += "VIII";
            break;
        case 9:
            outputString += "IX";
            break;
    }
    return outputString;
}

